import { useState } from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="bg-black text-white p-4 relative">
      <div className="flex justify-between items-center">
        <h1 className="font-bold text-xl">GenVision 2025</h1>

        {/* Desktop Menu */}
        <div className="hidden md:flex gap-8 text-lg font-semibold">
          <Link to="/" className="hover:text-gray-300">About</Link>
          <Link to="/Events" className="hover:text-gray-300">Events</Link>
          <Link to="/Participants" className="hover:text-gray-300">Participate</Link>
          <Link to="/Coordinators" className="hover:text-gray-300">Coordinators</Link>
          <Link to="/Guests" className="hover:text-gray-300">Guests</Link>
        </div>

        {/* Mobile Hamburger */}
        <div className="md:hidden flex flex-col justify-center items-center gap-1 cursor-pointer" onClick={() => setIsOpen(!isOpen)}>
          <span className={`block w-6 h-0.5 bg-white transition-transform ${isOpen ? "rotate-45 translate-y-1.5" : ""}`}></span>
          <span className={`block w-6 h-0.5 bg-white transition-opacity ${isOpen ? "opacity-0" : "opacity-100"}`}></span>
          <span className={`block w-6 h-0.5 bg-white transition-transform ${isOpen ? "-rotate-45 -translate-y-1.5" : ""}`}></span>
        </div>
      </div>

      {/* Mobile Menu */}
      <div className={`md:hidden overflow-hidden transition-all duration-300 ${isOpen ? "max-h-60 py-4" : "max-h-0"}`}>
        <div className="flex flex-col items-center gap-4">
          <Link to="/" className="hover:text-gray-300" onClick={() => setIsOpen(false)}>About</Link>
          <Link to="/Events" className="hover:text-gray-300" onClick={() => setIsOpen(false)}>Events</Link>
          <Link to="/Participants" className="hover:text-gray-300" onClick={() => setIsOpen(false)}>Participate</Link>
          <Link to="/Coordinators" className="hover:text-gray-300" onClick={() => setIsOpen(false)}>Coordinators</Link>
          <Link to="/Guests" className="hover:text-gray-300" onClick={() => setIsOpen(false)}>Guests</Link>
        </div>
      </div>
    </nav>
  );
}
